<h3>Introduction of the Library</h3>
<p class="so">The Central Library supports the teaching and research programmes of the Institute and provides facilities for general reading and disseminates information according to the requirement of the users. It is housed in a separate building with a carpet area of 2147Sq.ms, reading space 395.87 sq.ms. It has around 18000 including , books, back volumes of technical national and international journals, technical pamphlets, standards, CD-ROMs, Video cassettes etc. The database of entire library acquisitions was created using Library Application Software Called SOUL software.

The College Central Library caters to the needs of the user community i.e., UG and PG students, Research scholars, staff and faculty of the Jawaharlal Nehru technological University college of Engineering (Autonomous), Pulivendula. The College Central Library was fully automated with bar coding of the books from the year 2006 SOUL Library Software package. The main features of the SOUL Software are OPAC, Acquisition, Cataloguing, Circulation, Serial Control etc.</p>
 
<div class="card shadow p-3 mb-5  bg-white rounded">
<h3>Working Hours</h3>
<p  style="background-color: whitesmoke">The library is kept open throughout the year except for six days i.e., three national holidays and three festival holidays.It is kept open from 9.00 A.M. To 8.00 P.M on all working days and 10.00 A.M. to 4.00 P.M. On holidays.</p>
</div>
 
<div class="card shadow p-3 mb-5  bg-white rounded">
<h3>Different Sections of the library</h3>
<p>Acquisition section<br>
Technical Section<br>
Circulation section<br>
Periodical section<br>
Competitive exam cell<br>
electronic library<br>
