Stacks etc.</p>
</div>
 
<div class="card shadow p-3 mb-5  bg-white rounded">
<h3>Services of the central library are:</h3>
<p  style="background-color:whitesmoke">Charging and Discharging of books and non book material<br>
Reference service<br>
Inter Library Loan (ILL)<br>
E-access of e-resources<br>
Reprographic service and<br>
Referral service to the users.</p>
